/*
 * jQuery tablelist Plugin
 *
 * @author   zotop
 * @created  2012-11-14
 * @version  2.0
 * @site     http://zotop.com
*/

(function($) {
	// default
	$.tablelist = {options : {
		item : 'tr',
		ignore : 'thead > tr',
		selectall : 'input.select-all',
		oncheck : null
	}};

	function tablelist($table, options){
		var self = this;
		var $tr = $table.find(options.item).not(options.ignore);
		var $checkboxes = $tr.find('input:checkbox');

		// API methods
		$.extend(self, {
			//get checked length
			checked : function(){
				return $checkboxes.filter(':checked').length;
			},
			// select special node
			select : function(selector, state){
				$checkboxes.filter(selector).each(function(){
					this.checked = state;
					$(this).closest(options.item).toggleClass('selected', this.checked);
				});
				self.updateAll(($checkboxes.length === $checkboxes.filter(':checked').length));
			},
			//select all or unselect all
			selectAll : function(state){
				$checkboxes.each(function(){
					this.checked = state;
					$(this).closest(options.item).toggleClass('selected', this.checked);
				});
				self.updateAll(state);
			},
			// update selectall state
			updateAll : function(state){
				$(options.selectall).each(function(){
					this.checked = state;
				});
			}
		});

		// mouseover
		$tr.each(function(){
			$(this).hover(function(){
				$(this).addClass('mouseover');
			},function(){
				$(this).removeClass('mouseover');
			});
		});

		// select one
		$checkboxes.click(function(e){
			$(this).closest(options.item).toggleClass('selected', this.checked).toggleClass('mouseover', this.checked);
			self.updateAll(($checkboxes.length === $checkboxes.filter(':checked').length));
			if( typeof (options.oncheck) == "function" ){
				options.oncheck(this,$checkboxes,$tr);
			}
		});

		// select all
		$table.find(options.selectall).click(function(e){
			var state = $(e.target).is('input:checkbox') ? this.checked : $(this).attr('state');
			self.selectAll(state);
		});
	}

	// jQuery plugin initialization
	$.fn.tablelist = function(options){

		// setup options
		options = $.extend({}, $.tablelist.options, options);

		// install tablelist for each entry in jQuery object
		this.each(function(){
			instance = new tablelist($(this), options);
			$(this).removeData("tablelist").data("tablelist", instance);
		});

		// if options.api == true then return api,else return this
		return options.api ? api: this;
	}

	// default bind
	$(function(){
		$('table.list').each(function(){
			$(this).tablelist();
		});
	});
})(jQuery);


/*
 * jQuery select radio checkbox
 *
 * @author   zotop
 * @created  2012-11-14
 * @version  2.0
 * @site     http://zotop.com
*/
(function($) {

	//
	$.fn.checkboxes = function() {
		var checkboxes = function(self) {
			self.addClass("inline-checkboxes");
			self.children().hide();

			self.find(":checkbox").each(function(i) {
				var index = self.find(":checkbox").index(this);
				var item = $('<a href="javascript:;" class="item' + i + '">' + self.find('label').eq(index).text() + '</a>').appendTo(self);

				if ($(this).prop("checked") == true) {
					item.addClass("selected");
				}

				if ($(this).prop("disabled") == true) {
					item.css("cursor", "default");
					return;
				}

				$(item).click(function() {
					if ($(this).hasClass("selected")) {
						$(this).removeClass("selected");
					} else {
						$(this).addClass("selected");
					}

					self.find(':checkbox').eq(index).trigger("click");
				});
			});
		};
		return $(this).each(function() {
			checkboxes($(this));
		});
	}

	//
	$.fn.radios = function() {
		var multiRadio = function(self) {
			self.addClass("inline-radios"); //
			self.children().hide(); //
			self.find('input[type="radio"]').each(function(i) {
				var index = self.find('input[type="radio"]').index(this);
				var item = $('<a href="javascript:;" class="item' + i + '">' + self.find('label').eq(index).text() + '</a>').appendTo(self);
				if ($(this).prop("checked") == true) {
					item.addClass("selected");
				}

				if ($(this).prop("disabled") == true) {
					item.css("cursor", "default");
					return;
				}

				$(item).click(function() {
					$(this).siblings().removeClass("selected");
					$(this).addClass("selected");
					self.find('input[type="radio"]').prop("checked", false);
					self.find('input[type="radio"]').eq(index).prop("checked", true);
					self.find('input[type="radio"]').eq(index).trigger("click");
				});
			});
		};
		return $(this).each(function() {
			multiRadio($(this));
		});
	}

	//
	$.fn.singleselect = function() {
		var singleselect = function(self) {
			self.addClass("single-select");
			self.children().hide();
			var title = $('<a class="select-title" href="javascript:;"><span></span><i></i></a>').appendTo(self);
			var items = $('<div class="select-items"><ul></ul></div>').appendTo(self);
			var select = self.find("select").eq(0);

			select.find("option").each(function(i) {
				var index = select.find("option").index(this);
				var li = $('<li>' + $(this).text() + '</li>').appendTo(items.find("ul"));

				if ($(this).prop("selected") == true) {
					li.addClass("selected");
					title.find("span").text($(this).text());
				}

				if ($(this).prop("disabled") == true) {
					li.css("cursor", "default");
					return;
				}

				li.click(function() {
					$(this).siblings().removeClass("selected");
					$(this).addClass("selected");
					select.find("option").prop("selected", false);
					select.find("option").eq(index).prop("selected", true);
					title.find("span").text($(this).text());
					items.hide();
					select.trigger("change");
				});
			});

			if (select.prop("disabled") == true) {
				title.css("cursor", "default");
				return;
			}

			title.click(function(e) {
				e.stopPropagation();
				if (items.is(":hidden")) {
					$(".single-select .select-items").hide();
					//items.css("z-index", "1");
					items.show();
				} else {
					//items.css("z-index", "");
					items.hide();
				}
			});

			//
			$(document).click(function(e) {
				select.trigger("blur");
				items.hide();
			});
		};

		return $(this).each(function() {
			singleselect($(this));
		});
	}

	$(function() {
		$(".inline-checkboxes").checkboxes();
		$(".inline-radios").radios();
		$(".single-select").singleselect();
	});
})(jQuery);